import React, { useState } from 'react';

const RegistrarAlojamiento = ({ onCreate }) => {
  const [formValues, setFormValues] = useState({
    name: '',
    latitud: '',
    longitud: '',
    price: '',
    images: [],
    description: '',
    bedrooms: '',
    bathrooms: '',
    estado: 'Disponible', // Por defecto, el estado es 'Disponible' según la documentación
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormValues({ ...formValues, [name]: value });
  };

  const handleCreate = async () => {
    try {
      const response = await fetch('http://localhost:3001/alojamiento/createAlojamiento', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          Titulo: formValues.name,
          Descripción: formValues.description,
          TipoAlojamiento: 1, // Esto debería ser un tipo de dato específico según tu API
          Latitud: parseFloat(formValues.latitud),
          Longitud: parseFloat(formValues.longitud),
          PrecioPorDia: parseFloat(formValues.price),
          CantidadDormitorios: parseInt(formValues.bedrooms),
          CantidadBanios: parseInt(formValues.bathrooms),
          Estado: formValues.estado,
        }),
      });

      if (response.ok) {
        const data = await response.json();
        // Lógica adicional después de crear el alojamiento, por ejemplo, mostrar mensaje de éxito, etc.
        console.log('Alojamiento creado correctamente:', data);
        onCreate(data); // Ejecutar una función si es necesario después de la creación
        clearForm(); // Limpiar el formulario después de la creación exitosa
      } else {
        throw new Error('Error al crear el alojamiento');
      }
    } catch (error) {
      console.error('Error al crear el alojamiento:', error);
      // Manejar el error apropiadamente, por ejemplo, mostrar un mensaje al usuario
    }
  };

  const clearForm = () => {
    setFormValues({
      name: '',
      latitud: '',
      longitud: '',
      price: '',
      images: [],
      description: '',
      bedrooms: '',
      bathrooms: '',
      estado: 'Disponible', // Restablecer el estado a 'Disponible' después de limpiar
    });
  };

  return (
    <div className="registrar-alojamiento">
      <h2>Registrar Alojamiento</h2>
      <form>
        <div className="form-group">
          <label>Nombre:</label>
          <input type="text" name="name" value={formValues.name} onChange={handleChange} />
        </div>
        <div className="form-group">
          <label>Latitud:</label>
          <input type="text" name="latitud" value={formValues.latitud} onChange={handleChange} />
        </div>
        <div className="form-group">
          <label>Longitud:</label>
          <input type="text" name="longitud" value={formValues.longitud} onChange={handleChange} />
        </div>
        <div className="form-group">
          <label>Precio:</label>
          <input type="text" name="price" value={formValues.price} onChange={handleChange} />
        </div>
        <div className="form-group">
          <label>Descripción:</label>
          <textarea name="description" value={formValues.description} onChange={handleChange} />
        </div>
        <div className="form-group">
          <label>Dormitorios:</label>
          <input type="text" name="bedrooms" value={formValues.bedrooms} onChange={handleChange} />
        </div>
        <div className="form-group">
          <label>Baños:</label>
          <input type="text" name="bathrooms" value={formValues.bathrooms} onChange={handleChange} />
        </div>
        <div className="form-group">
          <label>Estado:</label>
          <input type="text" name="estado" value={formValues.estado} onChange={handleChange} />
        </div>
        <div className="button-group">
          <button type="button" onClick={handleCreate}>Registrar</button>
        </div>
      </form>
    </div>
  );
};

export default RegistrarAlojamiento;
